import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';

import FitnessCenterIcon from '@material-ui/icons/FitnessCenter';
import NotificationsNoneIcon from '@material-ui/icons/NotificationsNone';
import TimelineIcon from '@material-ui/icons/Timeline';
import MoreHorizIcon from '@material-ui/icons/MoreHoriz';

import { Link } from 'react-router-dom';

const useStyles = makeStyles({
  root: {
    width: '100vw',
    position: 'fixed',
    bottom: 0
  },
});

export default function BottomNav() {
  const classes = useStyles();
  const [value, setValue] = React.useState('recents');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <BottomNavigation value={value} onChange={handleChange} className={classes.root}>
        <Link to="/home"><BottomNavigationAction label="Dashboard" value="dashboard" icon={<NotificationsNoneIcon />} /></Link>
        <BottomNavigationAction label="Exercises" value="exercises" icon={<FitnessCenterIcon />} />
        <BottomNavigationAction label="Progress" value="progress" icon={<TimelineIcon />} />
        <BottomNavigationAction label="Extra" value="extra" icon={<MoreHorizIcon />} />
    </BottomNavigation>
  );
}
